// Next
import Image from "next/image";
import Link from "next/link";

// React
import { useContext, useEffect } from "react";

// Intersection Obs
import { useInView } from "react-intersection-observer";

// Context
import { AppContext } from "../../context/AppContext";

// Styles
import styles from "@/styles/components/layout/DefaultLayout.module.scss";

export default function DefaultLayout({
  children,
}: React.PropsWithChildren<{}>) {
  // When nav leaves viewport
  const { ref: nav, inView: navIsVisible } = useInView({
    threshold: 0,
  });
  /// className for navIsVisible ternary
  const navIsVisibleClass = navIsVisible
    ? `${styles.nav__links}`
    : `${styles.nav__links} ${styles["nav__links--active"]}`;

  // Active link when section in viewport
  const { section } = useContext(AppContext);
  /// Active link item className
  function active(activeSection: string) {
    if (section === activeSection) {
      return (
        styles["nav__links-item"] + " " + styles["nav__links-item--active"]
      );
    } else {
      return styles["nav__links-item"];
    }
  }

  // When section enters viewport
  const { ref: footer, inView: footerIsVisible } = useInView({
    threshold: 0.5,
  });
  /// Context
  const { setSection } = useContext(AppContext);
  /// Do the thing
  useEffect(() => {
    //@ts-ignore
    footerIsVisible ? setSection("Contact") : setSection("");
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [footerIsVisible]);
  return (
    <>
      <nav className={styles.nav} ref={nav}>
        <Image
          className={styles.nav__logo}
          src="data:image/jpeg;base64,"
          alt="Trey Designs Things logo"
          width="150"
          height="68"
        />
        <div className={navIsVisibleClass}>
          <Link className={active("What-I-Do")} href="#What-I-Do">
            WHAT I DO
          </Link>
          <Link className={active("Work")} href="#Work">
            WORK
          </Link>
          <Link className={active("Contact")} href="#Contact">
            CONTACT
          </Link>
        </div>
        <div className={styles.nav__socials}>
          <Link
            className={styles["nav__socials-link"]}
            href="https://www.instagram.com/treydesignsthings/"
            target="_blank"
          >
            <Image
              className={styles["nav__socials-link-item"]}
              src="data:image/svg+xml;base64,"
              alt="Instagram"
              width="20"
              height="20"
            />
          </Link>
          <Link
            className={styles["nav__socials-link"]}
            href="https://www.linkedin.com/in/atreocepeda/"
            target="_blank"
          >
            <Image
              className={styles["nav__socials-link-item"]}
              src="data:image/svg+xml;base64,"
              alt="LinkedIn"
              width="20"
              height="20"
            />
          </Link>
          <Link
            className={styles["nav__socials-link"]}
            href="https://www.behance.net/qawsenefekt"
            target="_blank"
          >
            <Image
              className={styles["nav__socials-link-item"]}
              src="data:image/svg+xml;base64,"
              alt="Behance"
              width="20"
              height="20"
            />
          </Link>
        </div>
      </nav>
      <main>{children}</main>
      <footer className={styles.footer} ref={footer} id="Contact">
        <div className={styles.footer__row}>
          <div className={styles["footer__row-col"]}>
            <h2 className={styles["footer__row-col-title"]}>Let&apos;s Chat</h2>
            <Link
              className={styles["footer__row-col-link"]}
              href="mailto:trey@treydesignsthigns.com"
            >
              trey@treydesignsthigns.com
            </Link>
          </div>
          <div
            className={`${styles["footer__row-col"]} ${styles["footer__row-col--socials"]}`}
          >
            <Link
              className={styles["footer__row-col-link"]}
              href="https://www.instagram.com/treydesignsthings/"
              target="_blank"
            >
              Instagram
            </Link>
            <Link
              className={styles["footer__row-col-link"]}
              href="https://www.behance.net/qawsenefekt"
              target="_blank"
            >
              Behance
            </Link>
            <Link
              className={styles["footer__row-col-link"]}
              href="https://www.linkedin.com/in/atreocepeda/"
              target="_blank"
            >
              Linkedin
            </Link>
          </div>
        </div>
        <Image
          className={styles.footer__logo}
          src="data:image/svg+xml;base64,"
          alt="Trey Designs Things footer logo"
          width="86"
          height="86"
        />
        <p className={styles.footer__copyright}>
          &#169; TREYDESIGNSTHINGS {new Date().getFullYear()}
        </p>
      </footer>
    </>
  );
}
